0'),(22,27,5,1,NULL,'2020-02-07 06:51:58','2020-02-07 06:51:58'),(23,28,13,1,'Las redes sociales son importantes para generar reconocimiento de marca. Nos encargamos de hacerlo Brutal. Además, realizamos una interpretación detallada y comprendemos las necesidades de tus clientes. \r\n#SomosBrutales #RedesSociales #BrutalesEnLoQueHacemos #BrutalDigitalAgency','2020-02-07 06:54:29','2020-02-07 06:54:29'),(24,29,13,1,'Optimiza tus redes sociales de manera Brutal Pieza 2: Item 1: Publica contenido e interactúa Item2: Menos contenido, más vistas Pieza 3: Item 1: Crea publicidad a tus post Item2: Construye una estrategia de Inbound Marketing Pieza 4: Item 1: Contesta comentarios y mensajes a tiempo.','2020-02-07 07:06:48','2020-02-07 07:06:48'),(25,30,13,1,'¿Conoces la importancia de promocionar un post?  \r\nPromocionar alguno de tus post te puede ayudar a encontrar más personas que te den un Like, compartan y comenten tus publicaciones, logrando posicionar tu marca y vender más. Nosotros lo hacemos Brutal.\r\n #SomosBrutales #Facebook #BussinesFacebook #Promocion #BrutalesEnLoQueHacemos','2020-02-07 07:09:16','2020-02-07 07:09:16'),(26,34,13,1,'Realizamos campañas BTL y lo hacemos Brutal. \r\nLanzamiento y promoción de tu producto o marca, haciendo uso de Pop Up Stores, estaciones digitales y exhibiciones físicas. \r\n#SomosBrutales #CampañasBTL #Campañas #BTL #BrutalesEnLoQueHacemos','2020-02-07 07:15:22','2020-02-07 07:15:22'),(27,38,13,1,'¡Desarrollamos Software a la medida y lo hacemos Brutal! \r\nHacemos realidad tu proyecto, creamos apps ligeras y robustas, empresariales y comerciales. ¡Software Brutal! \r\n#SomosBrutales #Desarrollo #Software #WEB #APP #Tecnologias #BrutalesEnLoQueHacemos','2020-02-07 07:16:30','2020-02-07 07:16:30'),(28,32,5,1,NULL,'2020-02-07 08:55:46','2020-02-07 08:55:46'),(29,86,5,2,'Aprobado','2020-04-28 08:50:58','2020-04-28 08:50:58');
