INSERT INTO `TBL_Publicacion` VALUES (1,1,'1900-01-01','MIXTO','Publicacion de prueba',NULL,'IMAGEN','FEED',NULL,'2019-12-27 15:46:56','2019-12-27 15:46:56'),(8,2,'2020-01-01','¡Luce unos dientes perfectos este año, con un tratamiento de Ortodoncia! Clínica Páramo te ofrece varias opciones para que tu elijas. Llama ahora y agenda tu cita. Tu sonrisa habla por ti.','¡Luce unos dientes perfectos este año, con un tratamiento de Ortodoncia! Clínica Páramo te ofrece varias opciones para que tu elijas. Llama ahora y agenda tu cita. Tu sonrisa habla por ti.','Ortodoncia','CARRUSEL','STORY',5,'2020-01-14 12:43:07','2020-01-14 17:41:21'),(10,2,'2020-01-02','Resalta tu mirada y luce un rostro radiante, dile adiós a las ojeras. Agenda tu valoración. Rejuvenecete','Resalta tu mirada y luce un rostro radiante, dile adiós a las ojeras. Agenda tu valoración. Rejuvenecete','Relleno de Ojeras','IMAGEN','FEED',NULL,'2020-01-14 12:46:02','2020-01-14 17:34:24'),(11,2,'2020-01-03','La #Liposucción de Papada es un tratamiento seguro y confiable. Deja todo en nuestras manos y seras uno mas de nuestros clientes felices. ¡Contactanos!','La #Liposucción de Papada es un tratamiento seguro y confiable. Deja todo en nuestras manos y seras uno mas de nuestros clientes felices. ¡Contactanos!','LipoPapada','IMAGEN','FEED',NULL,'2020-01-14 12:46:52','2020-01-14 17:34:44'),(12,2,'2020-01-04',NULL,'¿Quieres lucir tu rostro más joven? Todo es posible con Clínica Páramo, mantener tu piel sin arrugas o líneas de expresión sera mas fácil. Llama ahora y agenda tu cita.','Botox','IMAGEN','FEED',NULL,'2020-01-14 12:47:30','2020-01-14 12:47:30'),(13,2,'2020-01-05',NULL,'¿Tienes alguna urgencia Odontológica? No dudes en ir a nuestras instalaciones. Contamos con profesionales expertos en tratar cualquier imprevisto odontológico. Tu salud nos importa.','Nuestro Equipo','IMAGEN','FEED',NULL,'2020-01-14 12:48:15','2020-01-14 12:48:15'),(14,2,'2020-01-06',NULL,'¿Sientes tu rostro demasiado redondo? Esto dejará de ser un problema, mejora tu rostro con este procedimiento minimamente invasivo y luce mejor que nunca. Escríbenos para agendar ahora mismo tu cita de valoración, deja tu salud en nuestras manos.','Bichectomia','IMAGEN','FEED',NULL,'2020-01-14 12:49:02','2020-01-14 12:49:02'),(15,2,'2020-01-07',NULL,'Recupera tu confianza con implantes dentales, no permitas que nada te impida lucir este 2020 como siempre te ha gustado. Llama ya y agenda tu cita.','Implantes Dentales','IMAGEN','FEED',NULL,'2020-01-14 12:49:48','2020-01-14 12:49:48'),(16,2,'2020-01-08',NULL,'Mejora la forma de tu nariz. La Rinomodelación es un tratamiento invasivo que transformara totalmente la forma de tu nariz. Sin cirugía.','Rinomodelación (Antes y Despues)','IMAGEN','FEED',NULL,'2020-01-14 12:50:36','2020-01-14 12:50:36'),(17,2,'2020-01-09',NULL,'¿Te gustaría tener una sonrisa perfecta? Agenda ya tu cita de valoración y luce un diseño de sonrisa como siempre los has deseado.','Diseño de Sonrisa','IMAGEN','FEED',NULL,'2020-01-14 12:51:33','2020-01-14 12:51:33'),(18,2,'2020-01-10',NULL,'¿Deseas tener unos labios pronunciados y sensuales? No lo pienses más, llama ya y solicita una cita para realizarte el tratamiento. ¡Es muy sencillo con Ácido Hialurónico! Y luce esos labios que siempre has soñado tener.','Ácido Hialuronico (Labios)','IMAGEN','FEED',NULL,'2020-01-14 12:52:33','2020-01-14 12:52:33'),(19,2,'2020-01-11',NULL,'Perfila y luce tu rostro como siempre lo has querido, nuestros especialistas se encargaran de ayudararte a cumplir ese sueño. La #bichectomia, hace que tu cara se vea más delgada y joven.! Escríbenos ahora mismo y agenda ya tu cita.','Bichectomia','IMAGEN','FEED',NULL,'2020-01-14 12:53:08','2020-01-14 12:53:08'),(20,2,'2020-01-12',NULL,'Modernas Instalaciones, y un gran Equipo Profesional y amable. Calidad e Innovación. Visitanos.','Nuestro Equipo','IMAGEN','FEED',NULL,'2020-01-14 12:53:40','2020-01-14 12:53:40'),(21,2,'2020-01-13',NULL,'Pacientes Felices.','Bichectomia (Antes y Despues)','IMAGEN','FEED',NULL,'2020-01-14 12:54:10','2020-01-14 12:54:10'),(22,2,'2020-01-14',NULL,'Mejora la forma y color de tus labios con Ácido Hialuróico. Dales más volumen para lucir un rostro como siempre lo has querido tener. Escríbenos ahora para agendar una cita.','Acido Hialuronico (Labios)','IMAGEN','FEED',NULL,'2020-01-14 12:54:40','2020-01-14 12:54:40'),(23,2,'2020-01-15',NULL,'¿Necesitas brackets pero no te gustan como se ven? Con la ortodoncia lingual esto no será un problema, agenda tu cita ahora y descubre lo perfectos que pueden ser. ¡Contactanos!','Ortodoncia','IMAGEN','FEED',NULL,'2020-01-14 12:55:10','2020-01-14 12:55:10'),(39,3,'2020-02-16','General','Creamos estrategias de valor en el mercado digital, cumpliendo los objetivos del cliente.  #SomosBrutal #EstrategíaComercial #BrutalEnLoqueHacemos #BrutalDigitalAgency','Muestrale tu marca al mundo','CARRUSEL','FEED',NULL,'2020-02-07 11:21:45','2020-02-11 11:49:49'),(41,3,'2020-02-17','General','Pieza 1: Estrategias Digitales Pieza 2:  Item 1: Atraemos Item 2: Convertimos Item 3: Fedelizamos','Pieza 1: Estrategias Digitales Pieza 2:  Item 1: Atraemos Item2: Convertimos Item 3: Fedelizamos','CARRUSEL','STORY',NULL,'2020-02-07 11:22:34','2020-02-07 11:22:34'),(42,3,'2020-02-18','General','¿Sabes porque un Blog es importante para tu marca? 1. Mejora tu posición y calificación en Google. 2. Te genera reconocimiento de marca. 3. Generas contenido de valor para tus clientes. #SomosBrutal #BlogBrutal #BrutalEnLoQueHacemos #BrutalDigitalAgency','¿Antojado de un Blog?','IMAGEN','FEED',NULL,'2020-02-07 11:23:25','2020-02-07 11:23:25'),(43,3,'2020-02-19','General','Pieza 1: BrutalTips para un buen blog Pieza 2:  Item 1: Tener un buscador interno Item2: Permitir comentarios en tu Blog Pieza 3:  Item 1: Deja tu correo visible Item2: Realiza encuestas a tus lectores Pieza 4:  Item 1: Deja tus redes visibles Item2: Sorprende a tus lectores','Brutal Tips(Copy General)','CARRUSEL','STORY',NULL,'2020-02-07 11:25:12','2020-02-07 11:25:12'),(44,3,'2020-02-20','General','Las redes sociales son importantes para dar a conocer tu marca. En BRUTAL nos encargamos de hacerlo, además de interpretar y comprender las necesidades de tus clientes. #SomosBrutales #RedesSociales #BrutalesEnLoQueHacemos','(Logos de las redes sociales (FB, IG, WA, TW, IN) organizados como si fueran en media luna y el logo Brutal)','CARRUSEL','FEED',NULL,'2020-02-07 11:25:59','2020-02-11 11:50:36'),(45,3,'2020-02-21','General','Optimiza tus redes sociales de manera Brutal Pieza 2: Item 1: Publica contenido e interactúa Item2: Menos contenido, más vistas Pieza 3: Item 1: Crea publicidad a tus post Item2: Construye una estrategia de Inbound Marketing Pieza 4: Item 1: Contesta comentarios y mensajes a tiempo.','Brutal Tips(Copy General - Story)','CARRUSEL','STORY',NULL,'2020-02-07 11:26:50','2020-02-07 11:26:50'),(46,3,'2020-02-22','General','¿Conoces la importancia de promocionar un post? Promocionar alguno de tus post te puede ayudar a encontrar más personas que te den un Like, compartan y comenten tus publicaciones, logrando posicionar tu marca y vender más. Nosotros lo hacemos Brutal. \r\n#SomosBrutal #Facebook #BussinesFacebook #Promocion #BrutalEnLoQueHacemos.','(Logo de Facebook)  ¿Sabes promocionar posts?','CARRUSEL','FEED',NULL,'2020-02-07 11:27:28','2020-02-11 11:51:20'),(47,3,'2020-02-23','General','Instragram es ideal para el éxito tu marca (Logo de Ig algo bien chusco)','Instragram es ideal para el éxito tu marca (Logo de Ig algo bien chusco)','IMAGEN','STORY',NULL,'2020-02-07 11:27:55','2020-02-07 11:27:55'),(48,3,'2020-02-24','General','BRUTAL TIPS: 1. Cámbiate a un perfil de negocios  2. Interactúa con tus seguidores  3. Cuenta una historia en el pie de foto 4. Busca hashtags con alto volumen de publicaciones 5. Crea hashtags para tu empresa 6.Utiliza Instagram Stories 7. Realiza un sorteo o concurso \r\n#SomosBrutal #Instagram #Seguidores  #BrutalEnLoQueHacemos','7 Tips para ganar seguidores en Instagram','IMAGEN','FEED',NULL,'2020-02-07 11:29:55','2020-02-07 11:29:55'),(49,3,'2020-02-25','General','BRUTALES en activaciones de marca','Story(CopyGeneral)','CARRUSEL','FEED',NULL,'2020-02-07 11:30:37','2020-02-11 11:51:50'),(50,3,'2020-02-26','General','Realizamos campañas BTL y lo hacemos BRUTAL. Lanzamiento y promoción de tu producto o marca, haciendo uso de Pop Up Stores, estaciones digitales y exhibiciones físicas. \r\n#SomosBrutal #CampañasBTL #Campañas #BTL #BrutalEnLoQueHacemos','Campañas BTL','CARRUSEL','FEED',NULL,'2020-02-07 11:31:10','2020-02-07 11:31:10'),(51,3,'2020-02-27','General','El ADN de tu marca es una página WEB BRUTAL','El ADN de tu marca es una página WEB BRUTAL','CARRUSEL','FEED',NULL,'2020-02-07 11:31:28','2020-02-07 11:31:28'),(52,3,'2020-02-28','General','¡Desarrollamos Software a la medida y lo hacemos Brutal! Hacemos realidad tu proyecto, creamos apps ligeras y robustas, empresariales y comerciales. ¡Software BRUTAL! #SomosBrutal #Desarrollo #Software #WEB #APP #Tecnologias #BrutalEnLoQueHacemos.','Desarrollamos software BRUTAL','CARRUSEL','FEED',NULL,'2020-02-07 11:32:46','2020-02-11 11:52:40'),(53,3,'2020-02-29','General','Consultorias y asesorias, lo hacemos BRUTAL  \r\nwww.brutalagencydigital.com.co','Consultorias y asesorias, lo hacemos BRUTAL  www.brutalagencydigital.com.co','IMAGEN','STORY',NULL,'2020-02-07 11:33:22','2020-02-07 11:33:22'),(54,3,'2020-03-01','General','Contamos con personal idóneo para brindar apoyo, diagnóstico de marca y oportunidades nuevas que puedes ejecutar con seguridad. \r\n¡Que tu producto o servicio se convierta en una MARCA BRUTAL! \r\n#SomosBrutal #Consultor #Consultoria #BrutalEnLoQueHacemos','¿Buscando un consultor?','IMAGEN','FEED',NULL,'2020-02-07 11:34:20','2020-02-07 11:34:20'),(55,4,'2020-02-10','General','copy general de la publicacion','copy de la imagen','CARRUSEL','FEED',NULL,'2020-02-07 15:01:36','2020-02-07 15:18:31'),(58,5,'2020-05-01','Poseedor a Propietario.','¿Quieres obtener las es